const App = struct {
    text_renderer: TextRenderer,
    renderer: tic80.Renderer(BGRA, tic80.Shader(BGRA)),
    renderer_blending: tic80.Renderer(BGRA, tic80.ShaderWithBlendAndKeyColor(BGRA, 0)),
